import './App.css';
import { Cart, Main } from './pages';
import { Route } from 'react-router-dom';
import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <Router>

      <div>
        <Route path="/" exact component={Main} />
        <Route path="/cart" component={Cart} />
      </div>

    </Router>
  );
}

export default App;
